  false,\n\t\"url\": null,\n\t\"notes\": \"High resolution vegetation polygons mapped
  by the National Park Service. These data describe vegetation for the Whiskeytown
  National Recreation Area through the formation of polygons of similar vegetation
  cover. The desired minimum mapping unit was 0.5 hectares in size. However polygons
  as small as 0.1 hectares are included. Vegetation is classified according to the
  US National Vegetation Classification Standard (NVCS, http://www.fgdc.gov/standards/projects/FGDC-standards-projects/vegetation/NVCS_V2_FINAL_2008-02.pdf/)
  to the association level when possible (31 classes), to the alliance level. A \"Barren\"
  class and a \"Disturbed\" class are also included for a total of 38 categories.\",\n\t\"license_title\":
